fields.detail_text:
мы обеспечим соответствие цветов образцу ;
полную и точную пропечатку всех участков изображения без отмарывания оттисков;
отсутствие морщин и складок на наклейке, загнутых углов и других повреждений;
точные размеры, наличие технических полей и отступов;
качественное лаковое покрытие заданной толщины без пропусков, затеков, пузырей, различий в цветовом тоне;
отсутствие косины для точного совмещения противоположных сторон;
реализацию сложных контуров наклеек;
цифровую точную высечку необходимой глубины и без заусениц;
укрывистое тиснение фольгой без разрывов и складок, точная проработка деталей;
совмещение рельефного изображения с красочным при конгевном тиснении, подбор оптимальной глубины рельефа.
